// 统一请求路径前缀在libs/axios.js中修改
import { getRequest, postRequest, putRequest, deleteRequest, uploadFileRequest } from '@/libs/axios'; //垃圾分类贴士
//分页模糊获取贴士信息

export var getTipsList = function getTipsList(params) {
  return getRequest('/rubbishTips/getByCondition', params);
}; //启用贴士

export var enableTips = function enableTips(id, params) {
  return postRequest("/rubbishTips/enableTips/".concat(id), params);
}; //禁用贴士

export var disableTips = function disableTips(id, params) {
  return postRequest("/rubbishTips/disableTips/".concat(id), params);
}; //添加贴士

export var addTips = function addTips(params) {
  return postRequest('/rubbishTips/save', params);
}; //编辑贴士内容

export var editTips = function editTips(params) {
  return putRequest('/rubbishTips/update', params);
}; //删除贴士

export var deleteTips = function deleteTips(ids, params) {
  return deleteRequest("/rubbishTips/removeByIds/".concat(ids), params);
}; //通过id获取贴士信息

export var getTipsById = function getTipsById(id, params) {
  return getRequest("/rubbishTips/get/".concat(id), params);
}; //获取所有贴士信息

export var getAllList = function getAllList(params) {
  return getRequest('/rubbishTips/getAllList', params);
};
